commits.content:
.add_list_container{
    display: flex;
    flex-direction: column;
   width: 50%;
   margin: auto;
   margin-top: 100px;
  justify-content: center;
}
label{
    display: block;
}
div{
    margin-bottom: 20px;
}
input{
    width: 100%;
    height: 30px;
    border-radius: 20px;
    text-align: center;
    margin-top: 10px;
    font-size: 20px;
}
.addbtn{
    background-color: saddlebrown;
    padding: 7px;
    width: 200px;
    border-radius: 20px;
    font-size: 20px;
    color: white;
    align-self: center;
}
button{
    .addbtn{
        background-color: saddlebrown;
        padding: 7px;
        width: 200px;
        border-radius: 20px;
        font-size: 20px;
        color: white;
        align-self: center;
    }
}
